import React from 'react';

const Footer = () => {
    return (
        <footer>
            <nav className="navbar bg-dark shadow-lg">
                <p id='p' className='text-light mt-1' >Designed by Abduvakhob 2023</p>   
            </nav>
        </footer>
    );
}




export default Footer;
